INSERT INTO ENTRIES VALUES(1,'152049677','The McDonnell Douglas F-4 Phantom II is a tandem two-seat, twin-engine, all-weather, long-range supersonic jet interceptor and fighter-bomber originally developed for the United States Navy by McDonnell Aircraft. It first entered service in 1960 with the Navy. Proving highly adaptable, it was also adopted by the United States Marine Corps and the United States Air Force, and by the mid-1960s had become a major part of their air arms.','2020-06-07 20:09:52.792000','McDonnell Douglas F-4 Phantom II','2020-06-07 20:09:52.792000',1,1)
INSERT INTO ENTRIES VALUES(2,'847533352','The Northrop F-5 is a family of supersonic light fighter aircraft initially designed as a privately funded project in the late 1950s by Northrop Corporation. There are two main models, the original F-5A and F-5B Freedom Fighter variants and the extensively updated F-5E and F-5F Tiger II variants. The design team wrapped a small, highly aerodynamic fighter around two compact and high-thrust General Electric J85 engines, focusing on performance and a low cost of maintenance. Smaller and simpler than contemporaries such as the McDonnell Douglas F-4 Phantom II, the F-5 cost less to procure and operate, making it a popular export aircraft.','2020-06-07 20:09:52.792000','Northrop F-5E/F Tiger II','2020-06-07 20:09:52.792000',2,1)
INSERT INTO ENTRIES VALUES(3,'967314469','The Douglas A-4 Skyhawk is a single-seat subsonic carrier-capable light attack aircraft developed for the United States Navy and United States Marine Corps in the early 1950s. The delta-winged, single turbojet engined Skyhawk was designed and produced by Douglas Aircraft Company, and later by McDonnell Douglas. It was originally designated A4D under the U.S. Navy''s pre-1962 designation system.','2020-06-07 20:09:52.792000','Douglas A-4 Skyhawk','2020-06-07 20:09:52.792000',3,1)
INSERT INTO ENTRIES VALUES(4,'782397068','The Vought F-8 Crusader (originally F8U) is a single-engine, supersonic, carrier-based air superiority jet aircraft[2] built by Vought for the United States Navy and United States Marine Corps (replacing the Vought F7U Cutlass), and for the French Navy. The first F-8 prototype was ready for flight in February 1955. The F-8 served principally in the Vietnam War. The Crusader was the last American fighter with guns as the primary weapon, earning it the title "The Last of the Gunfighters".','2020-06-07 20:09:52.792000','Vought F-8 Crusader','2020-06-07 20:09:52.792000',1,1)
INSERT INTO ENTRIES VALUES(5,'308250411','The Israel Aircraft Industries Kfir (Hebrew: "Lion Cub") is an Israeli-built all-weather multirole combat aircraft based on the French Dassault Mirage 5, with Israeli avionics and an Israeli-built version of the General Electric J79 turbojet engine.','2020-06-07 20:09:52.792000','Israel Aircraft Industries Kfir','2020-06-07 20:09:52.792000',2,1)
